import React from "react";
import Header from "./Header";
import TopImage from "./TopImage";
import Topic from "./Topic";
import Footer from "./Footer";
import style from "../static/Style";

function Layout() {
  return (
    <div>
      {style}
      <Header />
      <TopImage />
      <Topic />
      <Footer />
    </div>
  );
}

export default Layout;
